import { NavLink } from 'react-router-dom';

export function MainNavigation(){
    return (
        <>
            <li>
                <NavLink to="/">Home</NavLink>
            </li>
            <li>
                <NavLink to="/events">Events</NavLink>
            </li>
        </>
    );
}
